class Solution(object):
    def increasingTriplet(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        dp = [1]*len(nums)
        for i in xrange(1,len(nums)):
            for j in xrange(i):
                if nums[j]<nums[i]:
                    dp[i] = max(dp[i],dp[j]+1)
                if dp[i] == 3:
                    return True
        return False

